const theme = {
  colors: {
    background: '#EFEFEF',     // Light Gray (background)
    text: '#333333',           // Charcoal Gray (text)
    primary: '#48284A',        // Electric Blue (primary)
    secondary: '#074F57',      // Hot Pink (secondary)
    accent: '#D1345B',         // Sunflower Yellow (accent)
    highlight: '#074F57',      // Mint Green (highlight)
  },
};

export default theme;
